Toro.VotacaoView=Ember.View.create({templateName:"votacao",elements:null,reset:function(){this.elements.removeClass("votar-button-disabled"),this.elements.removeAttr("disabled")},click:function(e){var t=Ember.$(e.target);this.elements=Ember.$(e.currentTarget.children),t.is("button")&&(this.reset(),t.addClass("votar-button-disabled"),t.attr("disabled","disabled"))}});